import React from 'react'
import './Logo.css'

const Logo = props => {
    return (
      <div className='leftCenter'>
        <img
          src="https://dtc-wsuv.org/vnguyen19/pho-gia-img/pho-gia-logo.png"
          alt="pho gia milwaukie logo"
          className="img"
        />
      </div>
    );
}

export default Logo
